Duplikaadi taotlemine Kui eesti keele tasemeeksami tunnistus on kaotatud, varastatud või rikutud, ei pea sellepärast eksamit uuesti tegema: võimalik on taotleda duplikaati. Duplikaadil on algdokumendiga võrdne juriidiline jõud. Duplikaati saab taotleda, kui - algdokumendi tekst on muutunud raskesti loetavaks; - tuvastatakse algdokumendi vormistamise ebatäpsus või algdokumendile kantud andmete ebaõigsus; - algdokument on hävinud, kadunud või ära varastatud; - algdokument on legaliseeritud või kin
..........
le on kantud ebaõiged andmed, tuleb taotlusele lisada ka algdokument. SA Innove väljastab duplikaadi 30 päeva jooksul pärast taotluse esitamist. SA Innove võtab taotlejaga ühendust, kui duplikaat on valmis. Alates 1. oktoobrist 2010 väljastatakse duplikaat e-tunnistusena. Elektroonilise tunnistuse saab alla laadida riigiportaalist www.eesti.ee Duplikaadi väljastamisest keeldutakse, kui ilmneb, et: 1. duplikaadi taotleja on esitanud valeandmeid; 2. puuduvad andmed algdokumendi väljaandmise kohta;
